string-array.item:
Hvis lommelykten din ikke fungerer, kan det skyldes følgende årsaker:
- Lommelykten har stanset hele tiden, muligens fordi strobe-modusen er på. Fremgangsmåte for å slå av strobe-modus: Tilbake til startsiden → Kontroller knappens posisjon under [SOS, 0 ~ 10] → Dra knappen til under nummer 0;
- Åpnet annen lommelyktapplikasjon eller kameraprogram samtidig, vennligst lukk disse appene;
- Tillater ikke kameratillatelse, lommelykten trenger kameratillatelse for å slå på lys. Fremgangsmåte for å tillate kameratillatelse: Tilbake til hjemmesiden → Klikk på av / på-knappen → Tillat kameratillatelser i popup-vinduet;
- Lommelykten på denne enheten er skadet. Du kan også bruke skjermlyset i stedet. Fremgangsmåte for å bruke skjermlys: Tilbake til startsiden → Klikk på skjermlysknappen nederst til høyre.
